import React from "react";
import Link from "next/link";
// import PropTypes from "prop-types";

const Header = () => {
	return (
		<>
			<div>Header created.</div>
			<Link href="/">
				<a>Home</a>
			</Link>
			&nbsp; | &nbps;
			<Link href="/about">
				<a>About</a>
			</Link>
		</>
	);
};

// Header.propTypes = {
// };

export default Header;
